import React, { Component } from "react";

class KeyBoard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      onShift: false,
      onKey: "",
    };
  }
  onShift = () => {
    console.log("on shift func");
    window.addEventListener("keydown", (e) => {
      if ((e.key === "Shift") | (e.key === "ShiftLeft")) {
        this.setState((prevState) => ({
          onShift: !prevState.onShift,
        }));
        console.log("in onshift", this.state.onShift);
      }
    });
  };
  onKey = () => {
    console.log("on key func");
    window.addEventListener("keydown", (e) => {
      this.setState({
        onKey: e.key,
      });
      console.log("in onshift", this.state.onKey);
    });
    window.addEventListener("keyup", (e) => {
      this.setState({
        onKey: "",
      });
      console.log("in onshift", this.state.onKey);
    });
  };
  componentDidMount() {
    this.onKey();
  }
  componentDidUpdate() {}
  render() {
    console.log("rerender");
    const keyboard = [
      [
        { txt: "~", shiftTxt: "`", u: 1 },
        { txt: "1", shiftTxt: "!", u: 1 },
        { txt: "2", shiftTxt: "@", u: 1 },
        { txt: "3", shiftTxt: "#", u: 1 },
        { txt: "4", shiftTxt: "$", u: 1 },
        { txt: "5", shiftTxt: "%", u: 1 },
        { txt: "6", shiftTxt: "^", u: 1 },
        { txt: "7", shiftTxt: "&", u: 1 },
        { txt: "8", shiftTxt: "*", u: 1 },
        { txt: "9", shiftTxt: "(", u: 1 },
        { txt: "0", shiftTxt: ")", u: 1 },
        { txt: "-", shiftTxt: "_", u: 1 },
        { txt: "=", shiftTxt: "+", u: 1 },
        { txt: "Backspace", shiftTxt: "Backspace", u: 2 },
      ],
      [
        { txt: "Tab", shiftTxt: "Tab", u: 1.5 },
        { txt: "q", shiftTxt: "`Q", u: 1 },
        { txt: "w", shiftTxt: "W", u: 1 },
        { txt: "e", shiftTxt: "E", u: 1 },
        { txt: "r", shiftTxt: "R", u: 1 },
        { txt: "t", shiftTxt: "T", u: 1 },
        { txt: "y", shiftTxt: "Y", u: 1 },
        { txt: "u", shiftTxt: "U", u: 1 },
        { txt: "i", shiftTxt: "I", u: 1 },
        { txt: "o", shiftTxt: "O", u: 1 },
        { txt: "p", shiftTxt: "P", u: 1 },
        { txt: "[", shiftTxt: "{", u: 1 },
        { txt: "]", shiftTxt: "}", u: 1 },
        { txt: "  ", shiftTxt: "|", u: 1 },
      ],
      [
        { txt: "CapsLock", shiftTxt: "CapsLock", u: 2 },
        { txt: "a", shiftTxt: "A", u: 1 },
        { txt: "s", shiftTxt: "S", u: 1 },
        { txt: "d", shiftTxt: "D", u: 1 },
        { txt: "f", shiftTxt: "F", u: 1 },
        { txt: "g", shiftTxt: "G", u: 1 },
        { txt: "h", shiftTxt: "H", u: 1 },
        { txt: "j", shiftTxt: "J", u: 1 },
        { txt: "k", shiftTxt: "K", u: 1 },
        { txt: "l", shiftTxt: "L", u: 1 },
        { txt: ";", shiftTxt: ":", u: 1 },
        { txt: `"`, shiftTxt: `'`, u: 1 },
        { txt: "Enter", shiftTxt: "Enter", u: 2.25 },
      ],
      [
        { txt: "Shift", shiftTxt: "Shift", u: 2.25 },
        { txt: "z", shiftTxt: "Z", u: 1 },
        { txt: "x", shiftTxt: "X", u: 1 },
        { txt: "c", shiftTxt: "C", u: 1 },
        { txt: "v", shiftTxt: "V", u: 1 },
        { txt: "b", shiftTxt: "B", u: 1 },
        { txt: "n", shiftTxt: "N", u: 1 },
        { txt: "m", shiftTxt: "M", u: 1 },
        { txt: ",", shiftTxt: "<", u: 1 },
        { txt: ".", shiftTxt: ">", u: 1 },
        { txt: "/", shiftTxt: "?", u: 1 },
        { txt: "Shift", shiftTxt: "Shift", u: 1 },
        { txt: "&uarr", shiftTxt: "&uarr", u: 1 },
        { txt: "Delete", shiftTxt: "Meta", u: 1 },
      ],
      [
        { txt: "Ctrl", shiftTxt: "Ctrl", u: 1 },
        { txt: "Alt", shiftTxt: "Meta", u: 1 },
        { txt: "Alt", shiftTxt: "Alt", u: 1 },
        { txt: " ", shiftTxt: " ", u: 6.5 },
        { txt: "Alt", shiftTxt: "Alt", u: 1 },
        { txt: "&larr;", shiftTxt: "&larr;", u: 1 },
        { txt: "&darr;", shiftTxt: "&darr;", u: 1 },
        { txt: "&rarr;", shiftTxt: "&rarr;", u: 1 },
      ],
    ];
    return (
      <div className="keyboard__wrapper">
        <div className="keyboard" data-skinstance="simpleKeyboard">
          <div className="keyboard__rows">
            {keyboard &&
              keyboard.map((item) => (
                <div className="keyboard__row">
                  {item.map((keys) => (
                    <div
                      className={
                        this.state.onKey === keys.txt ||
                        this.state.onKey === keys.shiftTxt
                          ? `keyboard__key active ` + ` ${keys.u}`
                          : "keyboard__key" + ` ${keys.u}`
                      }
                    >
                      {this.state.onShift ? (
                        <span>{keys.shiftTxt}</span>
                      ) : (
                        <span>{keys.txt}</span>
                      )}
                    </div>
                  ))}
                </div>
              ))}
          </div>
        </div>
      </div>
    );
  }
}

export default KeyBoard;
